INSERT INTO `tt_err_collection` VALUES (1,'java数据传输时中文乱码（在发送mq时，传入数据正常，但是消费者接收的数据是乱码的）','网络传输会对数据进行编码','java中编码：URLEncoder.encode(URLEncoder.encode(\"传递的中文\",\"utf-8\"));\njava中解码码：URLDecoder.decode(request.getParameter(\'documentPath\'),\"utf-8\");','2018-09-28 11:26:59',NULL,'2018-09-28 11:26:59',1,'java'),(2,'sts工具配置，解决properties文件中文乱码','','换了工作空间，难免会改一些配置，为了减少搜索时间特记此。\n\n步骤 : 点击sts界面的window -> preferences -> General -> Content Type -> Text -> 选中Java Properties File，在下面修改编码为UTF-8，应用即可\n\n','2018-09-28 11:28:34',NULL,'2018-09-28 11:28:34',1,'java'),(3,'as','','https://oscimg.oschina.net/oscnet/2c9b96c2b5d76906cebc256c881e31302be.jpg','2018-09-28 11:29:09',NULL,'2018-09-28 11:29:09',2,'java'),(4,'java数据传输时中文乱码（在发送mq时，传入数据正常，但是消费者接收的数据是乱码的）','网络传输会对数据进行编码','java中编码：URLEncoder.encode(URLEncoder.encode(\"传递的中文\",\"utf-8\")); java中解码码：URLDecoder.decode(request.getParameter(\'documentPath\'),\"utf-8\");','2018-09-28 13:08:24',NULL,'2018-09-28 13:08:24',1,'vue'),(5,'\njava数据传输时中文乱码（在发送mq时，传入数据正常，但是消费者接收的数据是乱码的）','网络传输会对数据进行编码','java中编码：URLEncoder.encode(URLEncoder.encode(\"传递的中文\",\"utf-8\")); java中解码码：URLDecoder.decode(request.getParameter(\'documentPath\'),\"utf-8\");','2018-09-28 13:34:24',NULL,'2018-09-28 13:34:24',1,'linux'),(6,'测一下','试试','  试试','2018-11-09 13:42:13',NULL,'2018-11-09 13:42:13',1,'java');
